import pandas as pdimport matplotlib.pyplot as pltimport numpy as npdf= pd.read_csv("/Users/jennifer/Jen_Data_Science/datasci2020/HW9_Dataset/Jennifer_data.csv", sep=',',                skiprows=[0],header=0,names=['','pless','pfault','ordna','ofault','bin'],                na_values='--')df.dtypes#columns:['Unnamed: 0: int64', 'pless: float64' ,'pfault: object' , 'ordna: float64,' , 'ofault: object' , 'bin: int64'], dtype: object#the unnamed column seemes to simply be ordering the data points by number#the two distributions seem to be 'pless' and 'ordna' as they both have a central tendency towards a similar valuedf.shape #554 lines, 6 columns in the data file#"bad values"df.isna()df.isna().sum() #554 useful data points in each column except 549 for 'ordna'df = df.dropna(axis = 0, how = 'any')  #drop rows with any column having np.nan valueslen(df) #549 since we dropped the lines with missing valuesdf.nunique()dist1=df['pless'].valuesdist1.astype('float')dist2=df['ordna'].valuesdist2.astype('float')df.describe()from pandas.plotting import register_matplotlib_convertershist_p = plt.hist(dist1,alpha=0.5,bins=np.arange(50),label='pless')hist_o = plt.hist(dist2,alpha=0.5,bins=np.arange(50),label='ordna')plt.xlim(30,55)plt.xlabel('values')plt.ylabel('frequency')plt.legend()plt.title('Values and Frequencies')#looks somewhat Gaussian but both datasets look to be skewed to the leftrepeat_patients = df.groupby(by = 'patient_id').size().sort_values(ascending =False)repeat_patients